function Card({data}){
    return(
        <div className="card">
            <div className="card">
                <h1>ID: {data.id}</h1>
                <p>{data.title}</p>
                <p>{data.body}</p>
                <a href=""></a>
            </div>
        </div>
    )
}
export default Card
